import "./productstyles.css";
import Productdata from "./productdata";
import image1  from "../assets/image1.jpg";


function Product() {
  return (
    <div className="trip">
      <h1>Trip</h1>
      <p>Travel Destination</p>
      <div className="tripcard">
        <Productdata
          image={image1}
          heading="Trip in Italy"
          text="Italy offers beautiful scenery ranging from its scenic coastal areas to its colorful mountain ranges. It boasts a vast wealth of culture, architecture, and ancient sites. Italy also has modern cities that embody contemporary charm. Let's not forget Italy's culinary delights and its wonderful cuisine and wines."
          package="130000"
        />
        
      </div>
    </div>
  );
}

export default Product;
